import React, {useState, useEffect} from 'react';
import Toggle from './Togglebutton';


function Diagnose(){

    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch('/sys').then(
            res => res.json()
        ).then(
            data => {
                setData(data)
                console.log(data)
            }
        )  
    }, [])


    return (
        <div>
            <h1>Diagnosis results</h1>
            {data.map((item) => {
                <Toggle name={item} />
            })
            }
            {/* {
                (typeof data === "undefined") ? (
                    <p> Loading...</p>
                ):(
                    data.map((item) => {
                        <h1>hello</h1>
                    })

                )
            } */}
        </div>
    );
}

export default Diagnose;
